"use strict";
const timeString = '8h30';
// Split the time string into hours and minutes
const [hours, minutes] = timeString.split('h').map(Number);
// Create a new Date object for today
const date = new Date();
// Set the hours and minutes d
date.setHours(hours);
date.setMinutes(minutes);
date.setSeconds(0);
// Optional: set seconds to 0 if not specified
console.log(date);
